import React from 'react';
import logo from './levvel-logo.svg';
import './App.css';


const getData = async () => {
  try{
    const response = await fetch('https://jsonplaceholder.typicode.com/todos/1', {cache: 'no-cache'});
    if(response.ok){
      const d = await response.json();
    }
    throw new Error('Request failed!');
  }
  catch(error){
    console.log(error);
  }
}


